[{'comment_id': 570998390, 'comment_body': 'Coding style: CUPS puts open braces on their own line (not K&R), uses (traditional) 8 column tabs, and two spaces of indentation, e.g.:

```
else
{
  _cupsLanfPrintf(stderr, _("%s: Error - ..."), argv[0]);
  usage(NULL);
}
```
', 'comment_created': datetime.datetime(2021, 2, 5, 14, 19, 3, tzinfo=datetime.timezone.utc), 'commenter': 'michaelrsweet', 'type': 'User'}, {'comment_id': 570998460, 'comment_body': 'Messages need to use the `_("string")` macro in order to get scanned by gettext (which we use to build the message catalog).
', 'comment_created': datetime.datetime(2021, 2, 5, 14, 19, 9, tzinfo=datetime.timezone.utc), 'commenter': 'michaelrsweet', 'type': 'User'}, {'comment_id': 571088792, 'comment_body': "I don't exactly know why its showing like this in github. I am using vscode editor for editing files. `else` statement and opening brace `{` are being shown in vertical line there.", 'comment_created': datetime.datetime(2021, 2, 5, 16, 24, 51, tzinfo=datetime.timezone.utc), 'commenter': 'surajkulriya', 'type': 'User'}]
